register.text:
case class TStep(depNode: DepGraph#NodeT, scope: StepScope) {
  def dstep: DStep = depNode.toOuter
  def id: Id = depNode.toOuter.innermost.id
}

private[design]
object TStep {
  def apply(node: DepGraph#NodeT): TStep = TStep(node, node.toOuter.toStepScope)



}

object TaskGraph {
    type Edge = DiEdge[TStep]
    object Edge {
      def apply(source: TStep, target: TStep): Edge = new DiEdge(source, target)
    }

    def apply(nodes: Iterable[TStep], edges: Iterable[Edge]): TaskGraph =
      scalax.collection.immutable.Graph.from(nodes, edges)
  }
